// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

/**
 * @title RegistrationContract
 * @dev Contract 1: Handle certificate storage and election setup (Steps 0-1)
 * Purpose: Store voter certificates and set up election parameters
 */
contract RegistrationContract {

    // Reentrancy guard
    uint256 private constant _NOT_ENTERED = 1;
    uint256 private constant _ENTERED = 2;
    uint256 private _status;

    modifier nonReentrant() {
        require(_status != _ENTERED, "ReentrancyGuard: reentrant call");
        _status = _ENTERED;
        _;
        _status = _NOT_ENTERED;
    }
    // Certificate structure for voter registration
    struct Certificate {
        bytes governmentSignature;  // σ˜v = PKS.sign(Puv, Prgov)
        bytes governmentPublicKey;  // Pugov
        bytes voterPublicKey;       // Puv (LSAG public key)
    }

    // State variables
    mapping(bytes => bool) public certifiedPublicKeys;  // Track valid certificates
    bytes32 public electionId;                          // L
    bytes32[] public candidates;                        // C
    bytes32 public randomChallenge;                     // r
    address public electionAuthority;                   // EA address
    bool public electionSetup;                          // Setup status
    address private _owner;

    // Events
    event CertificateStored(bytes indexed voterPublicKey);
    event ElectionSetup(bytes32 indexed electionId, uint256 candidateCount);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == _owner, "Ownable: caller is not the owner");
        _;
    }

    modifier onlyElectionAuthority() {
        require(msg.sender == electionAuthority, "Only election authority can call this function");
        _;
    }

    modifier validCertificate(Certificate memory cert) {
        require(cert.governmentSignature.length > 0, "Government signature cannot be empty");
        require(cert.governmentPublicKey.length > 0, "Government public key cannot be empty");
        require(cert.voterPublicKey.length > 0, "Voter public key cannot be empty");
        _;
    }

    /**
     * @dev Constructor sets the election authority
     * @param _electionAuthority Address of the election authority
     */
    constructor(address _electionAuthority) {
        require(_electionAuthority != address(0), "Invalid election authority address");
        electionAuthority = _electionAuthority;
        _owner = msg.sender;
        _status = _NOT_ENTERED;
        emit OwnershipTransferred(address(0), msg.sender);
    }

    /**
     * @dev Store a voter's certificate after government verification
     * @param cert Certificate struct containing signature and keys
     * @return success Boolean indicating successful storage
     */
    function storePub(Certificate memory cert) 
        public 
        nonReentrant 
        validCertificate(cert) 
        returns (bool success) 
    {
        // Check if public key is already certified
        require(!certifiedPublicKeys[cert.voterPublicKey], "Public key already certified");

        // Verify government signature using PKS.verify
        require(
            _verifyGovernmentSignature(
                cert.voterPublicKey, 
                cert.governmentPublicKey, 
                cert.governmentSignature
            ), 
            "Invalid government signature"
        );

        // Store the certified public key
        certifiedPublicKeys[cert.voterPublicKey] = true;

        emit CertificateStored(cert.voterPublicKey);
        return true;
    }

    /**
     * @dev Store election parameters and setup election
     * @param _electionId Election identifier
     * @param _candidates Array of candidate identifiers
     * @param _randomChallenge Random challenge for LSAG signatures
     * @return success Boolean indicating successful setup
     */
    function storePollParams(
        bytes32 _electionId,
        bytes32[] memory _candidates,
        bytes32 _randomChallenge
    ) 
        public 
        onlyElectionAuthority 
        nonReentrant 
        returns (bool success) 
    {
        require(!electionSetup, "Election already setup");
        require(_electionId != bytes32(0), "Invalid election ID");
        require(_candidates.length > 0, "Must have at least one candidate");
        require(_randomChallenge != bytes32(0), "Invalid random challenge");

        electionId = _electionId;
        candidates = _candidates;
        randomChallenge = _randomChallenge;
        electionSetup = true;

        emit ElectionSetup(_electionId, _candidates.length);
        return true;
    }

    /**
     * @dev Check if a public key is certified
     * @param publicKey Voter's public key to check
     * @return certified Boolean indicating certification status
     */
    function isCertified(bytes memory publicKey) 
        public 
        view 
        returns (bool certified) 
    {
        return certifiedPublicKeys[publicKey];
    }

    /**
     * @dev Get all candidates
     * @return candidateList Array of candidate identifiers
     */
    function getCandidates() 
        public 
        view 
        returns (bytes32[] memory candidateList) 
    {
        return candidates;
    }

    /**
     * @dev Get election setup status
     * @return setup Boolean indicating if election is set up
     */
    function isElectionSetup() 
        public 
        view 
        returns (bool setup) 
    {
        return electionSetup;
    }

    /**
     * @dev Internal function to verify government signature
     * @param voterPublicKey Voter's public key
     * @param governmentPublicKey Government's public key
     * @param signature Government's signature
     * @return valid Boolean indicating signature validity
     */
    function _verifyGovernmentSignature(
        bytes memory voterPublicKey,
        bytes memory governmentPublicKey,
        bytes memory signature
    ) 
        internal 
        pure 
        returns (bool valid) 
    {
        // Implementation note: This is a simplified verification
        // In a real implementation, this would use actual PKS.verify
        // For now, we'll use a basic hash-based verification

        bytes32 messageHash = keccak256(abi.encodePacked(voterPublicKey, governmentPublicKey));
        bytes32 signatureHash = keccak256(signature);

        // This is a placeholder verification - replace with actual PKS verification
        return signatureHash != bytes32(0) && messageHash != bytes32(0);
    }

    /**
     * @dev Update election authority (only current authority can do this)
     * @param newAuthority Address of new election authority
     */
    function updateElectionAuthority(address newAuthority) 
        public 
        onlyElectionAuthority 
    {
        require(newAuthority != address(0), "Invalid new authority address");
        electionAuthority = newAuthority;
    }

    /**
     * @dev Emergency function to reset election setup (only authority)
     */
    function resetElectionSetup() 
        public 
        onlyElectionAuthority 
    {
        electionSetup = false;
        delete electionId;
        delete candidates;
        delete randomChallenge;
    }

    /**
     * @dev Returns the address of the current owner
     */
    function owner() public view returns (address) {
        return _owner;
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`)
     * Can only be called by the current owner
     */
    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

contracts/VoterRegistrationContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

// Interface for Registration Contract
interface IRegistrationContract {
    function isCertified(bytes memory publicKey) external view returns (bool);
    function electionId() external view returns (bytes32);
    function candidates() external view returns (bytes32[] memory);
    function electionSetup() external view returns (bool);
}

/**
 * @title VoterRegistrationContract
 * @dev Contract 2: Handle anonymous voter registration with LSAG signatures (Step 2)
 * Purpose: Register voters anonymously using LSAG signatures
 */
contract VoterRegistrationContract {

    // Reentrancy guard
    uint256 private constant _NOT_ENTERED = 1;
    uint256 private constant _ENTERED = 2;
    uint256 private _status;

    modifier nonReentrant() {
        require(_status != _ENTERED, "ReentrancyGuard: reentrant call");
        _status = _ENTERED;
        _;
        _status = _NOT_ENTERED;
    }

    // Voter record structure
    struct VoterRecord {
        bytes lsagSignature;        // σv = LSAG.sign(L, Pu, Prv)
        bytes votingPublicKey;      // Pu'v (new voting public key)
        bool isRegistered;
        uint256 registrationTime;
    }

    // State variables
    mapping(uint256 => VoterRecord) public registeredVoters;
    mapping(bytes => bool) public usedKeyImages;        // Prevent double registration
    uint256 public voterCount;
    address public registrationContract;                // Reference to RegistrationContract

    // Events
    event VoterRegistered(uint256 indexed voterIndex, bytes votingPublicKey);
    event RegistrationRejected(bytes lsagSignature, string reason);

    // Modifiers
    modifier onlyWhenElectionSetup() {
        require(
            IRegistrationContract(registrationContract).electionSetup(),
            "Election not setup yet"
        );
        _;
    }

    modifier validSignatureAndKey(bytes memory lsagSignature, bytes memory votingPublicKey) {
        require(lsagSignature.length > 0, "LSAG signature cannot be empty");
        require(votingPublicKey.length > 0, "Voting public key cannot be empty");
        _;
    }

    /**
     * @dev Constructor sets the registration contract address
     * @param _registrationContract Address of the RegistrationContract
     */
    constructor(address _registrationContract) {
        require(_registrationContract != address(0), "Invalid registration contract address");
        registrationContract = _registrationContract;
        _status = _NOT_ENTERED;
    }

    /**
     * @dev Verify LSAG signature and register voter
     * @param lsagSignature LSAG signature on election ID
     * @param votingPublicKey New voting public key (Pu'v)
     * @return voterIndex Assigned voter index (kv)
     */
    function verify(
        bytes memory lsagSignature,
        bytes memory votingPublicKey
    ) 
        public 
        nonReentrant 
        onlyWhenElectionSetup
        validSignatureAndKey(lsagSignature, votingPublicKey)
        returns (uint256 voterIndex) 
    {
        // Get election ID from registration contract
        bytes32 electionId = IRegistrationContract(registrationContract).electionId();

        // Extract key image from LSAG signature for linkability check
        bytes memory keyImage = _extractKeyImage(lsagSignature);

        // Check if this key image has been used (prevent double registration)
        if (usedKeyImages[keyImage]) {
            emit RegistrationRejected(lsagSignature, "Key image already used");
            revert("Double registration attempt detected");
        }

        // Verify LSAG signature against certified public keys
        require(
            _verifyLSAGSignature(lsagSignature, electionId),
            "Invalid LSAG signature"
        );

        // Check linkability using LSAG.linkVer
        require(
            _checkLinkability(lsagSignature, keyImage),
            "Linkability check failed"
        );

        // Register the voter
        voterIndex = voterCount;
        registeredVoters[voterIndex] = VoterRecord({
            lsagSignature: lsagSignature,
            votingPublicKey: votingPublicKey,
            isRegistered: true,
            registrationTime: block.timestamp
        });

        // Mark key image as used
        usedKeyImages[keyImage] = true;
        voterCount++;

        emit VoterRegistered(voterIndex, votingPublicKey);
        return voterIndex;
    }

    /**
     * @dev Check if a voter is registered
     * @param voterIndex Voter index to check
     * @return registered Boolean indicating registration status
     */
    function isRegistered(uint256 voterIndex) 
        public 
        view 
        returns (bool registered) 
    {
        return voterIndex < voterCount && registeredVoters[voterIndex].isRegistered;
    }

    /**
     * @dev Get total number of registered voters
     * @return count Total voter count
     */
    function getVoterCount() 
        public 
        view 
        returns (uint256 count) 
    {
        return voterCount;
    }

    /**
     * @dev Get voter record by index
     * @param voterIndex Index of the voter
     * @return record VoterRecord struct
     */
    function getVoterRecord(uint256 voterIndex) 
        public 
        view 
        returns (VoterRecord memory record) 
    {
        require(voterIndex < voterCount, "Invalid voter index");
        return registeredVoters[voterIndex];
    }

    /**
     * @dev Internal function to extract key image from LSAG signature
     * @param lsagSignature The LSAG signature
     * @return keyImage Extracted key image for linkability
     */
    function _extractKeyImage(bytes memory lsagSignature) 
        internal 
        pure 
        returns (bytes memory keyImage) 
    {
        // Implementation note: This is a simplified extraction
        // In a real implementation, this would parse the actual LSAG signature structure
        // For now, we'll use a hash-based approach to simulate key image extraction

        require(lsagSignature.length >= 32, "Invalid LSAG signature length");

        // Extract the first 32 bytes as key image (simplified)
        keyImage = new bytes(32);
        for (uint i = 0; i < 32; i++) {
            keyImage[i] = lsagSignature[i];
        }

        return keyImage;
    }

    /**
     * @dev Internal function to verify LSAG signature
     * @param lsagSignature The LSAG signature to verify
     * @param electionId The election ID that was signed
     * @return valid Boolean indicating signature validity
     */
    function _verifyLSAGSignature(
        bytes memory lsagSignature,
        bytes32 electionId
    ) 
        internal 
        pure 
        returns (bool valid) 
    {
        // Implementation note: This is a simplified verification
        // In a real implementation, this would use actual LSAG.verify
        // against the ring of certified public keys from RegistrationContract

        bytes32 messageHash = keccak256(abi.encodePacked(electionId));
        bytes32 signatureHash = keccak256(lsagSignature);

        // This is a placeholder verification - replace with actual LSAG verification
        // Should verify against ring of certified public keys
        return signatureHash != bytes32(0) && messageHash != bytes32(0);
    }

    /**
     * @dev Internal function to check linkability
     * @param lsagSignature The LSAG signature
     * @param keyImage The extracted key image
     * @return valid Boolean indicating linkability check result
     */
    function _checkLinkability(
        bytes memory lsagSignature,
        bytes memory keyImage
    ) 
        internal 
        pure 
        returns (bool valid) 
    {
        // Implementation note: This is a simplified linkability check
        // In a real implementation, this would use LSAG.linkVer

        bytes32 sigHash = keccak256(lsagSignature);
        bytes32 keyImageHash = keccak256(keyImage);

        // This is a placeholder check - replace with actual LSAG linkability verification
        return sigHash != bytes32(0) && keyImageHash != bytes32(0);
    }

    /**
     * @dev Check if a key image has been used
     * @param keyImage The key image to check
     * @return used Boolean indicating if key image is used
     */
    function isKeyImageUsed(bytes memory keyImage) 
        public 
        view 
        returns (bool used) 
    {
        return usedKeyImages[keyImage];
    }

    /**
     * @dev Get registration statistics
     * @return totalRegistered Total number of registered voters
     * @return registrationOpen Whether registration is still open
     */
    function getRegistrationStats() 
        public 
        view 
        returns (uint256 totalRegistered, bool registrationOpen) 
    {
        totalRegistered = voterCount;
        registrationOpen = IRegistrationContract(registrationContract).electionSetup();
        return (totalRegistered, registrationOpen);
    }
}

contracts/VotingAndTallyingContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

// Interface for VoterRegistrationContract
interface IVoterRegistrationContract {
    struct VoterRecord {
        bytes lsagSignature;
        bytes votingPublicKey;
        bool isRegistered;
        uint256 registrationTime;
    }

    function isRegistered(uint256 voterIndex) external view returns (bool);
    function registeredVoters(uint256 index) external view returns (VoterRecord memory);
    function getVoterCount() external view returns (uint256);
}

// Interface for RegistrationContract
interface IRegistrationContract {
    function electionId() external view returns (bytes32);
    function candidates() external view returns (bytes32[] memory);
    function electionAuthority() external view returns (address);
    function electionSetup() external view returns (bool);
}

/**
 * @title VotingAndTallyingContract
 * @dev Contract 3: Handle vote casting and tallying phases (Steps 3-4)
 * Purpose: Manage voting process and tally results
 */
contract VotingAndTallyingContract {

    // Reentrancy guard
    uint256 private constant _NOT_ENTERED = 1;
    uint256 private constant _ENTERED = 2;
    uint256 private _status;

    modifier nonReentrant() {
        require(_status != _ENTERED, "ReentrancyGuard: reentrant call");
        _status = _ENTERED;
        _;
        _status = _NOT_ENTERED;
    }

    // Vote record structure
    struct VoteRecord {
        bytes signatureOnHash;      // σ''v = PKS.sign(hv, Pr'v)
        bytes32 voteHash;           // hv = H(σ'v, L)
        bool voteSubmitted;
        bool voteTallied;
        uint256 submissionTime;
    }

    // State variables
    mapping(uint256 => VoteRecord) public votes;
    mapping(bytes32 => uint256) public tallyResults;    // Final vote counts per candidate
    address public voterRegistrationContract;          // Reference to VoterRegistrationContract
    address public registrationContract;               // Reference to RegistrationContract
    bool public votingPhaseActive;
    bool public tallyingPhaseActive;
    bool public resultsFinalized;

    // Additional tracking variables
    uint256 public totalVotesCast;
    uint256 public totalVotesTallied;

    // Events
    event VoteCast(uint256 indexed voterIndex, bytes32 voteHash);
    event VoteTallied(uint256 indexed voterIndex, bytes32 indexed candidate);
    event PhaseChanged(string phase, bool active);
    event ResultsFinalized(bytes32[] candidates, uint256[] voteCounts);

    // Modifiers
    modifier onlyElectionAuthority() {
        address authority = IRegistrationContract(registrationContract).electionAuthority();
        require(msg.sender == authority, "Only election authority can call this function");
        _;
    }

    modifier onlyDuringVoting() {
        require(votingPhaseActive, "Voting phase is not active");
        require(!tallyingPhaseActive, "Tallying phase has started");
        _;
    }

    modifier onlyDuringTallying() {
        require(tallyingPhaseActive, "Tallying phase is not active");
        require(!resultsFinalized, "Results already finalized");
        _;
    }

    modifier onlyRegisteredVoter(uint256 voterIndex) {
        require(
            IVoterRegistrationContract(voterRegistrationContract).isRegistered(voterIndex),
            "Voter is not registered"
        );
        _;
    }

    modifier validVoteData(bytes memory signatureOnHash, bytes32 voteHash) {
        require(signatureOnHash.length > 0, "Signature on hash cannot be empty");
        require(voteHash != bytes32(0), "Vote hash cannot be empty");
        _;
    }

    /**
     * @dev Constructor sets the contract addresses
     * @param _voterRegistrationContract Address of VoterRegistrationContract
     * @param _registrationContract Address of RegistrationContract
     */
    constructor(
        address _voterRegistrationContract,
        address _registrationContract
    ) {
        require(_voterRegistrationContract != address(0), "Invalid voter registration contract");
        require(_registrationContract != address(0), "Invalid registration contract");

        voterRegistrationContract = _voterRegistrationContract;
        registrationContract = _registrationContract;
        _status = _NOT_ENTERED;
    }

    /**
     * @dev Cast a vote during voting phase
     * @param signatureOnHash Signature on vote hash (σ''v = PKS.sign(hv, Pr'v))
     * @param voteHash Vote hash (hv = H(σ'v, L))
     * @param voterIndex Voter's registration index
     * @return success Boolean indicating successful vote casting
     */
    function voting(
        bytes memory signatureOnHash,
        bytes32 voteHash,
        uint256 voterIndex
    ) 
        public 
        nonReentrant 
        onlyDuringVoting 
        onlyRegisteredVoter(voterIndex)
        validVoteData(signatureOnHash, voteHash)
        returns (bool success) 
    {
        require(!votes[voterIndex].voteSubmitted, "Vote already submitted");

        // Get voter's voting public key
        IVoterRegistrationContract.VoterRecord memory voterRecord = 
            IVoterRegistrationContract(voterRegistrationContract).registeredVoters(voterIndex);

        // Verify signature on hash using voter's voting public key
        require(
            _verifySignatureOnHash(signatureOnHash, voteHash, voterRecord.votingPublicKey),
            "Invalid signature on vote hash"
        );

        // Store vote record
        votes[voterIndex] = VoteRecord({
            signatureOnHash: signatureOnHash,
            voteHash: voteHash,
            voteSubmitted: true,
            voteTallied: false,
            submissionTime: block.timestamp
        });

        totalVotesCast++;
        emit VoteCast(voterIndex, voteHash);
        return true;
    }

    /**
     * @dev Tally a vote during tallying phase
     * @param actualVoteSignature Actual vote signature (σ'v = PKS.sign(candidate, Pr'v))
     * @param voterIndex Voter's registration index
     * @return success Boolean indicating successful tallying
     */
    function tally(
        bytes memory actualVoteSignature,
        uint256 voterIndex
    ) 
        public 
        nonReentrant 
        onlyDuringTallying 
        onlyRegisteredVoter(voterIndex)
        returns (bool success) 
    {
        require(votes[voterIndex].voteSubmitted, "No vote submitted for this voter");
        require(!votes[voterIndex].voteTallied, "Vote already tallied");

        // Get election ID
        bytes32 electionId = IRegistrationContract(registrationContract).electionId();

        // Verify stored vote hash matches H(actualVoteSignature, electionId)
        bytes32 computedHash = keccak256(abi.encodePacked(actualVoteSignature, electionId));
        require(
            computedHash == votes[voterIndex].voteHash,
            "Vote hash verification failed"
        );

        // Extract candidate from signature and verify it's valid
        bytes32 candidate = _extractCandidateFromSignature(actualVoteSignature);
        require(_isValidCandidate(candidate), "Invalid candidate");

        // Get voter's voting public key for signature verification
        IVoterRegistrationContract.VoterRecord memory voterRecord = 
            IVoterRegistrationContract(voterRegistrationContract).registeredVoters(voterIndex);

        // Verify signature corresponds to a valid candidate
        require(
            _verifyVoteSignature(actualVoteSignature, candidate, voterRecord.votingPublicKey),
            "Invalid vote signature"
        );

        // Increment vote count for the candidate
        tallyResults[candidate]++;
        votes[voterIndex].voteTallied = true;
        totalVotesTallied++;

        emit VoteTallied(voterIndex, candidate);
        return true;
    }

    /**
     * @dev Get tally results
     * @return candidates Array of candidate identifiers
     * @return voteCounts Array of vote counts per candidate
     */
    function getTallyResults() 
        public 
        view 
        returns (bytes32[] memory candidates, uint256[] memory voteCounts) 
    {
        bytes32[] memory allCandidates = IRegistrationContract(registrationContract).candidates();
        uint256[] memory counts = new uint256[](allCandidates.length);

        for (uint256 i = 0; i < allCandidates.length; i++) {
            counts[i] = tallyResults[allCandidates[i]];
        }

        return (allCandidates, counts);
    }

    /**
     * @dev Start voting phase
     * @return success Boolean indicating successful phase start
     */
    function startVotingPhase() 
        public 
        onlyElectionAuthority 
        returns (bool success) 
    {
        require(
            IRegistrationContract(registrationContract).electionSetup(),
            "Election not setup"
        );
        require(!votingPhaseActive, "Voting phase already active");
        require(!tallyingPhaseActive, "Cannot start voting during tallying");

        votingPhaseActive = true;
        emit PhaseChanged("voting", true);
        return true;
    }

    /**
     * @dev Start tallying phase (ends voting)
     * @return success Boolean indicating successful phase transition
     */
    function startTallyingPhase() 
        public 
        onlyElectionAuthority 
        returns (bool success) 
    {
        require(votingPhaseActive, "Voting phase must be active first");
        require(!tallyingPhaseActive, "Tallying phase already active");

        votingPhaseActive = false;
        tallyingPhaseActive = true;

        emit PhaseChanged("voting", false);
        emit PhaseChanged("tallying", true);
        return true;
    }

    /**
     * @dev Finalize results (ends tallying)
     * @return success Boolean indicating successful finalization
     */
    function finalizeResults() 
        public 
        onlyElectionAuthority 
        returns (bool success) 
    {
        require(tallyingPhaseActive, "Tallying phase must be active");
        require(!resultsFinalized, "Results already finalized");

        tallyingPhaseActive = false;
        resultsFinalized = true;

        (bytes32[] memory candidates, uint256[] memory voteCounts) = getTallyResults();

        emit PhaseChanged("tallying", false);
        emit ResultsFinalized(candidates, voteCounts);
        return true;
    }

    /**
     * @dev Internal function to verify signature on hash
     * @param signatureOnHash The signature on the hash
     * @param voteHash The vote hash
     * @param votingPublicKey Voter's voting public key
     * @return valid Boolean indicating signature validity
     */
    function _verifySignatureOnHash(
        bytes memory signatureOnHash,
        bytes32 voteHash,
        bytes memory votingPublicKey
    ) 
        internal 
        pure 
        returns (bool valid) 
    {
        // Implementation note: This is a simplified verification
        // In a real implementation, this would use actual PKS.verify

        bytes32 messageHash = keccak256(abi.encodePacked(voteHash, votingPublicKey));
        bytes32 sigHash = keccak256(signatureOnHash);

        // This is a placeholder verification - replace with actual PKS verification
        return sigHash != bytes32(0) && messageHash != bytes32(0);
    }

    /**
     * @dev Internal function to extract candidate from vote signature
     * @param voteSignature The vote signature
     * @return candidate The candidate identifier
     */
    function _extractCandidateFromSignature(bytes memory voteSignature) 
        internal 
        pure 
        returns (bytes32 candidate) 
    {
        // Implementation note: This is a simplified extraction
        // In a real implementation, this would parse the actual signature structure

        require(voteSignature.length >= 32, "Invalid vote signature length");

        // Extract candidate from signature (simplified approach)
        bytes32 extractedCandidate;
        assembly {
            extractedCandidate := mload(add(voteSignature, 32))
        }

        return extractedCandidate;
    }

    /**
     * @dev Internal function to check if candidate is valid
     * @param candidate The candidate identifier to check
     * @return valid Boolean indicating candidate validity
     */
    function _isValidCandidate(bytes32 candidate) 
        internal 
        view 
        returns (bool valid) 
    {
        bytes32[] memory validCandidates = IRegistrationContract(registrationContract).candidates();

        for (uint256 i = 0; i < validCandidates.length; i++) {
            if (validCandidates[i] == candidate) {
                return true;
            }
        }

        return false;
    }

    /**
     * @dev Internal function to verify vote signature
     * @param voteSignature The vote signature
     * @param candidate The candidate being voted for
     * @param votingPublicKey Voter's voting public key
     * @return valid Boolean indicating signature validity
     */
    function _verifyVoteSignature(
        bytes memory voteSignature,
        bytes32 candidate,
        bytes memory votingPublicKey
    ) 
        internal 
        pure 
        returns (bool valid) 
    {
        // Implementation note: This is a simplified verification
        // In a real implementation, this would use actual PKS.verify

        bytes32 messageHash = keccak256(abi.encodePacked(candidate, votingPublicKey));
        bytes32 sigHash = keccak256(voteSignature);

        // This is a placeholder verification - replace with actual PKS verification
        return sigHash != bytes32(0) && messageHash != bytes32(0);
    }

    /**
     * @dev Get voting statistics
     * @return totalRegistered Total registered voters
     * @return votesCast Total votes cast
     * @return votesTallied Total votes tallied
     * @return currentPhase Current election phase
     */
    function getVotingStats() 
        public 
        view 
        returns (
            uint256 totalRegistered,
            uint256 votesCast,
            uint256 votesTallied,
            string memory currentPhase
        ) 
    {
        totalRegistered = IVoterRegistrationContract(voterRegistrationContract).getVoterCount();
        votesCast = totalVotesCast;
        votesTallied = totalVotesTallied;

        if (resultsFinalized) {
            currentPhase = "finalized";
        } else if (tallyingPhaseActive) {
            currentPhase = "tallying";
        } else if (votingPhaseActive) {
            currentPhase = "voting";
        } else {
            currentPhase = "setup";
        }

        return (totalRegistered, votesCast, votesTallied, currentPhase);
    }

    /**
     * @dev Check if voter has cast a vote
     * @param voterIndex Voter's registration index
     * @return voted Boolean indicating if vote was cast
     */
    function hasVoted(uint256 voterIndex) 
        public 
        view 
        returns (bool voted) 
    {
        return votes[voterIndex].voteSubmitted;
    }

    /**
     * @dev Check if voter's vote has been tallied
     * @param voterIndex Voter's registration index
     * @return isTallied Boolean indicating if vote was tallied
     */
    function isVoteTallied(uint256 voterIndex) 
        public 
        view 
        returns (bool isTallied) 
    {
        return votes[voterIndex].voteTallied;
    }
}

